import './leftSide.css'
import { NavLink } from "react-router-dom";

// console.log()
const LeftSide = () => {
    return (
        <span id='leftSpan' className='desktop'>
            <div id='leftSpan_Overlay'>
                <NavLink style={isActive => ({ color: isActive ? "var(--color5)" : "black" })} className="NavLink" to="/home">
                    <div className='leftNav_selected home'>
                        <div id='leftNav_home'></div>
                        <p>Home</p>
                    </div>
                </NavLink>

                <NavLink isActive={(match, location) => {
    if (match) {
        alert('dddd')
      return false;
    }

    // only consider an event active if its event id is an odd number
    const eventID = parseInt(match.params.eventID);
    return !isNaN(eventID) && eventID % 2 === 1;
  }} style={isActive => ({ color: isActive ? "var(--color5)" : "black" })} className="NavLink" to="/ledger">
                    <div className='leftNav_selected cashbook'>
                        <div id='leftNav_cashbook'></div>
                        <p>Cashbook</p>
                    </div>
                </NavLink>

                <NavLink style={isActive => ({ color: isActive ? "var(--color5)" : "black" })} className="NavLink" to="/enventory">
                    <div className='leftNav_selected enventory'>
                        <div id='leftNav_enventory'></div>
                        <p>Enventory</p>
                    </div>
                </NavLink>

                <NavLink style={isActive => ({ color: isActive ? "var(--color5)" : "black" })} className="NavLink" to="/keepSafe">
                    <div className='leftNav_selected keepsafe'>
                        <div id='leftNav_keepsafe'></div>
                        <p>Keep safe</p>
                    </div>
                </NavLink>
            </div>
        </span>
    );
}

export default LeftSide;
